css:
:host atom-text-editor .highlight.block-execution .region,
atom-text-editor atom-text-editor .highlight.block-execution .region,
atom-text-editor::shadow atom-text-editor .highlight.block-execution .region {
  position: absolute;
  pointer-events: none;
  z-index: -1;
}
:host .highlights .block-execution .region,
atom-text-editor .highlights .block-execution .region,
atom-text-editor::shadow .highlights .block-execution .region {
  background-color: rgba(155, 149, 0, 0.6);
}
.proto-repl.ink.inline.result {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  max-width: 700px;
}
